Sentence Withheld.  Defendant is placed on probation to DOC for three (3) years on counts 1 and 6 and five (5) years on count 3.
Conditions of probation:
1) Spend six (6) months in the county jail, under the Huber Law, on count 3 only, commencing on 02-11-16 by 6:00 p.m.;
2) Spend an additional six (6) months in the county jail, under the Huber Law, on count 3 only, stayed and to be imposed at the agents discretion and upon order of the court;
3) Maintain absolute sobriety;
4) Pay court costs including the buy money;
5) pay supervision fees in an amount to be determined by DOC;
6) AODA assessment and follow through;
7) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
8) Submit to random urine screens and pay for same;
9) Defendant is to take all medications as prescribed and as prescribed by medical professionals and is to notify her agent of any changes in her medications.
The defendant has credit for 1 day if revoked.
